import { useState, useEffect } from "react";
import "./Signup.css";
import "react-toastify/dist/ReactToastify.css";
import { NavLink  } from "react-router-dom";
import axios from "axios";
import logo from "../../../../assets/cookieLogo.png"

function Signup() {
  const  [setUser] = useState([]);
  const [imagee, SetImagee] = useState("");
  const [error, setError] = useState([]);
  const [valid, setValid] = useState(false);
  const [formData, setFormData] = useState({
    _id: "",
    name: "",
    email: "",
    password: "",
    image: "",
  });
console.log(valid)
  const registerUser = async (userData) => {
    try {
      const formDataToSend = new FormData();
      formDataToSend.append("name", userData.name);
      formDataToSend.append("email", userData.email);
      formDataToSend.append("password", userData.password);
      formDataToSend.append("image", imagee);

      const res = await axios.post(
        "http://localhost:1112/user",
        formDataToSend
      );

      if (!res.data.success) {
        // console.log(res.data.success)
        setError(res.data.message);
        setValid(true);
      } else {
        setUser((prevRents) => [...prevRents, res.data.data]);
      }
    } catch (err) {
      if (err.response && err.response.data) {
        setError(err.response.data.message);
      } else {
        console.log(err);
      }
    }
  };

  const handleSignUp = async (e) => {
    e.preventDefault();
    registerUser(formData);
  };

  const handleImageChange = (e) => {
    e.preventDefault();
    SetImagee(e.target.files[0]);
  };
  useEffect(() => {
    if (valid ) {
      var timer;

      timer = setTimeout(() => {
        setValid(false);
      }, 4000);
    }
  },[]);

  return (
    <div className="Signup">


      <div className="Signupbox">

        <div className="SignupFormBox">
        <NavLink to="/" className="logo SignupLogo"><img src={logo} alt=""className="logo SignupLogo"  /></NavLink>

        <h1 className="Signuptitle">Sign up</h1>
        {valid ? <i className="ErrorMessageSignup">{error}</i> :null}

        <form action="#" className="SignupForm">
          <div className="SignupInputs">
            <div className="input-field">
              <input
                type="text"
                placeholder="Name"
                className="Signupinput"
                onChange={(e) =>
                  setFormData({ ...formData, name: e.target.value })
                }
              />
            </div>
            <div className="input-field">
              <input
                type="text"
                placeholder="Email"
                className="Signupinput"
                onChange={(e) =>
                  setFormData({ ...formData, email: e.target.value })
                }
              />
            </div>
            <div className="input-field">
              <input
                type="password"
                placeholder="Password"
                className="Signupinput"
                onChange={(e) =>
                  setFormData({ ...formData, password: e.target.value })
                }
              />
            </div>
            <div className="input-field picinput">
              <input
                type="file"
                id="file"
                name="Image"
                style={{ display: "none" }}
                className="Signupinput"
                onChange={handleImageChange}
              />
              <label htmlFor="file" className=" Signupinput">
                Profile Picture
              </label>
            </div>
          </div>
          <div className="SignupButton-txt">
            <input
              type="submit"
              value="Sign Up"
              className="btn solid SignupButton"
              onClick={handleSignUp}
            />
            <p>
              Already have an account?
              <NavLink to="/Login" className="signupInSignupTxt">
                {" "}
                Login.
              </NavLink>
            </p>
          </div>
        </form>
        </div>

      </div>
    </div>
  );
}

export default Signup;
